INSERT INTO `faqs` VALUES (31,13,'¿Cuántos usuarios pueden acceder a la misma cuenta?','Solo 1 persona, en caso de que nuestro sistema de monitoreo detecte que es una cuenta compartida, al instante se restringirá el acceso a la cuenta.',1,'2020-04-14 03:08:34','2020-04-14 03:23:19'),(32,13,'¿Cómo puedo iniciarme?','En esta plataforma encontraras cursos donde puedes desarrollar tus habilidades, la motivación para ser un samurái en el hacking, la iniciativa para educarte por ti mismo con las mejores herramientas. ¡Empieza ya!',1,'2020-04-14 03:09:21','2020-04-14 03:23:51'),(33,13,'¿Qué debo hacer si quiero tomar un curso en Xecure Labs?','Simplemente regístrarte en nuestra plataforma.',1,'2020-04-14 03:10:22','2020-04-14 03:23:54'),(34,13,'¿Cómo puedo registrarme?','• Manualmente ingresando e-mail, usuario, contraseña y verificación de correo electrónico.\r\n\r\n• Con tus cuentas de: Google, Facebook, LinkedIn o Twitter.',1,'2020-04-14 03:12:05','2020-04-14 03:24:01'),(35,13,'¿Por qué debo registrarme?','De esta manera podrás acceder a nuestros cursos gratuitos.',1,'2020-04-14 03:13:06','2020-04-14 03:22:35'),(36,14,'¿Cómo son los cursos de Xecure Labs?','• Pago por curso: en el cual elegirás el curso de acuerdo a tu interés y el que se adapte más a tus posibilidades.\r\n• Cursos Gratis: Como un bonus extra, nuestra plataforma cuenta con varios cursos gratuitos a tu disposición, de acuerdo a nuestra tendencia iremos compartiendo más, únicamente debes registrarte para tener acceso a ellos.',1,'2020-04-14 03:13:52','2020-04-14 03:26:22'),(37,14,'¿Qué incluye la suscripción?','Contamos con dos modalidades:\r\n• Suscripción Por curso: Al adquirir el curso de tu preferencia tendrás acceso él durante 90 días a partir de que se efectúa el pago.\r\n• Suscripción Anual.',1,'2020-04-14 03:14:18','2020-04-14 03:26:17'),(38,14,'¿Cuáles son los métodos de pago que aceptan?','Tenemos varias opciones de pago:\r\n• Por defecto es mediante PayPal.\r\n• Por tarjeta de crédito/débito.\r\n• Pagos offline como depósito bancario en varios países.\r\n\r\nSolicita el pago con la alternativa que más te convenga al suscribirte al curso.',1,'2020-04-14 03:14:55','2020-04-14 03:26:14'),(39,14,'Después de realizar el pago ¿En cuánto tiempo tendré acceso al curso?','•  PayPal: Se activa de inmediato\r\n•  Con tarjeta crédito/débito: Se activa de inmediato\r\n•  Depósito bancario: Cuando realices la transferencia, envía un email con los detalles del depósito a support@xecure-labs.com Incluyendo una captura o fotografía del comprobante. El proceso será realizado en días hábiles para verificarlo con el banco. Puede tardar hasta 24 horas. \r\n\r\nUna vez confirmado que se acreditó correctamente el pago, tendrás acceso a todo el contenido.',1,'2020-04-14 03:15:45','2020-04-14 19:23:56'),(40,14,'¿Hacen devoluciones de dinero?','No se hacen devoluciones de dinero.',1,'2020-04-14 03:16:01','2020-04-14 03:26:04'),(41,13,'¿Puedo obtener certificado?','Si, la plataforma de Xecure Labs emite certificados al reconocer la finalización de un curso ya sea gratuito o de pago.',1,'2020-04-14 03:16:14','2020-04-14 03:22:00'),(42,13,'¿Cómo descargo mi certificado?','Encontrarás en tu sección de cursos inscritos una sub/sección llamada certificados donde podrás visualizar los certificados de los cursos finalizados, ahí podras descargarlo en formato pdf.',1,'2020-04-14 03:16:35','2020-04-14 03:22:54'),(43,13,'¿Cuánto tiempo me costará aprender hacking y/o pentesting?','Dependiendo de tus habilidades y los cursos que vayas escalando en Xecure Labs.',1,'2020-04-14 03:16:48','2020-04-14 03:25:15'),(44,13,'¿Dónde puedo encontrar hackers de verdad para interactuar con ellos?','En nuestra plataforma podrás interactuar mediante el chat live, además te recomendamos un foro amigo underc0de.org/foro de la cultura hacker donde encontraras información muy útil.',1,'2020-04-14 03:17:06','2020-04-14 03:23:10');
/*!40000 ALTER TABLE `faqs` ENABLE KEYS */;
UNLOCK TABLES;

