ap</li>\n                                    <li>Now click on the dropdown from the left. By default <b>Medium</b> is selected. Click on it and Select <b>Large</b></li>\n                                    <li>Now Click on <b class=\"text-primary\">COPY HTML</b> link from it and <b>Paste</b> that code here in <b>Location on Map</b>.</li>\n                                </ol>','2020-02-27 15:29:43','2020-04-16 11:44:37'),(2476,0,'en','labels','backend.general_settings.contact.title','Contact','2020-02-27 15:29:43','2020-04-16 11:44:37'),(2477,0,'en','labels','backend.general_settings.contact.primary_email_note','This email will be used to correspond \"Contact Us\" emails','2020-02-27 15:29:43','2020-04-16 11:44:37'),(2478,0,'en','labels','backend.general_settings.footer.short_description','Short Description','2020-02-27 15:29:43','2020-04-16 11:44:37'),(2479,0,'en','labels','backend.general_settings.footer.popular_categories','Popular categories','2020-02-27 15:29:43','2020-04-16 11:44:37'),(2480,0,'en','labels','backend.general_settings.footer.featured_courses','Featured courses','2020-02-27 15:29:43','2020-04-16 11:44:37'),(2481,0,'en','labels','backend.general_settings.footer.trending_courses','Trending courses','2020-02-27 15:29:43','2020-04-16 11:44:37'),(2482,0,'en','labels','backend.general_settings.footer.popular_courses','Popular courses','2020-02-27 15:29:43','2020-04-16 11:44:37'),(2483,0,'en','labels','backend.general_settings.footer.custom_links','Custom Links','2020-02-27 15:29:43','2020-04-16 11:44:37'),(2484,0,'en','labels','backend.general_settings.footer.social_links','Social Links','2020-02-27 15:29:43','2020-04-16 11:44:37'),(2485,0,'en','labels','backend.general_settings.footer.link_url','URL','2020-02-27 15:29:43','2020-04-16 11:44:37'),(2486,0,'en','labels','backend.general_settings.footer.social_links_note','Add social link URL and select Icon for that media from iconpicker. Click on <b>ADD +</b> button. And your social link will be created. 