INSERT INTO `reasons` VALUES (1,'Contactos','Conoce personas alrededor del mundo con el mismo objetivo: aprender de seguridad informática.','far fa-address-card',1,'2020-02-27 15:32:48','2020-04-18 22:04:19'),(2,'¿Sin tiempo?','La educación en línea, te permite gestionar tu propio tiempo, avanzar a tu ritmo y aprendizaje constante.','fab fa-algolia',1,'2020-02-27 15:32:48','2020-04-18 22:11:13'),(3,'Mensajes privados','Podrás conversar con los maestros directamente y en vivo.','far fa-comments',1,'2020-02-27 15:32:48','2020-04-18 22:21:07'),(4,'Corrupti qui et est suscipit et.','Quod doloribus facilis vel illo vitae. Vitae ducimus harum enim ut.','fab fa-adversal',0,'2020-02-27 15:32:48','2020-04-18 21:14:00'),(5,'Similique excepturi veniam amet nihil laborum totam.','Et ab illo voluptas voluptates quis quaerat cumque. Reprehenderit earum corrupti officia fuga. Magni quia repellendus iure et placeat odit.','fab fa-affiliatetheme',0,'2020-02-27 15:32:48','2020-04-18 21:14:02'),(6,'Exercitationem sit maxime ipsa modi vel.','Inventore corporis qui libero ipsa ratione accusamus. Sapiente earum et rerum eos aut et.','fab fa-amazon',0,'2020-02-27 15:32:48','2020-04-18 21:14:03'),(7,'Plataforma con actualizaciones','Al igual que nuestra plataforma está en constantes actualizaciones, nuestros vídeos también.','fas fa-check-circle',1,'2020-02-27 15:32:48','2020-04-18 22:14:39'),(8,'Aprender a desaprender','El mundo está en constante cambio, debemos aprender a desaprender y nuestro campo no es la excepción.','fas fa-book',1,'2020-02-27 15:32:48','2020-04-18 22:13:27'),(9,'Quia veritatis minus voluptates.','Fugiat sequi tempora odio rerum voluptatem. Similique fugit nulla fugit non deleniti dolores. Voluptatem suscipit laboriosam atque tempora ut alias similique iusto.','fab fa-adn',0,'2020-02-27 15:32:48','2020-04-18 21:14:07'),(10,'Instructores capacitados','Nos dedicamos a diario. Estarás a mano de instructores profesionales en el área para mejorar tu aprendizaje.','fas fa-allergies',1,'2020-02-27 15:32:48','2020-04-18 22:12:10');
