INSERT INTO `testimonials` VALUES (1,'Edal Curi','Suscriptor de Youtube','Amigos Luis, extraordinario aporte, muchísimas gracias por compartir.\r\nEspero seguir contando con sus valiosas contribuciones al conocimiento.',1,'2020-02-27 15:32:48','2020-04-18 21:01:50'),(2,'Vicente Motos - Vis0r','CEO Hackplayers','Un prometedor punto de encuentro para entusiastas y estudiantes que quieran adentrarse en el mundo del hacking y la seguridad informática',1,'2020-02-27 15:32:48','2020-04-23 12:42:33'),(3,'Alex Criollo','Suscriptor de Youtube','Gracias por tu aportación a la comunidad, un nuevo alumno.',1,'2020-02-27 15:32:48','2020-04-18 21:04:53'),(4,'Fernando Bravo','Suscriptor de Youtube','Tienes un buen contenido, estoy por comenzar lo todo completo. Es de mi interés.',1,'2020-02-27 15:32:48','2020-04-18 21:05:27'),(5,'Koimbra','Suscriptor de Youtube','Grande amigos, sigan así, son los mejores.',1,'2020-02-27 15:32:48','2020-04-18 21:07:18'),(6,'Gaston Ramirez','Suscriptor de Youtube','Con gusto vere todos sus videos.',1,'2020-02-27 15:32:48','2020-04-18 21:07:49'),(7,'Angel Godinez','Suscriptor de Youtube','Muy buena explicación la verdad, muy buenos los videos.',1,'2020-02-27 15:32:48','2020-04-18 21:08:59'),(8,'Sebastian Ortega','Suscriptor de Youtube','Fantásticos videos y clarísimos.',1,'2020-02-27 15:32:48','2020-04-18 21:11:28'),(9,'Pedro Montenegro','Suscriptor de Youtube','Hola, me estoy recién introduciendo en esto de la seguridad informática, comencé desde 0 y hasta ahora he aprendido mucho con tus vídeos. Muchas gracias.',1,'2020-02-27 15:32:48','2020-04-18 21:12:52'),(10,'Sr. Roderick','Suscriptor de Youtube','Esperare lo nuevo. Si que me han ayudado tus vídeos.',1,'2020-02-27 15:32:48','2020-04-18 21:02:28');
/*!40000 ALTER TABLE `testimonials` ENABLE KEYS */;
